Storyline:


     Dan Tomlinson, aka Will Sabre, head of a gang of outlaws, states his intentions to go straight but is warned by the new gang leader, Dunsten, that he has thirty days to come back to the gang---or else.  Dan gets a job as a bank teller, but suspicion falls on him when a hold-up occurs and he doesn't use his guns. Now he has to find a way to capture Dunsten and his gang, and clear his name.





